import React from 'react';
import './App.css';
import { Button, TextField } from '@material-ui/core';

class RandButton extends React.Component{
    Roll=(Number)=>{
        const min = 1;
        const max = Number;
        const rand = min + Math.random() * (max - min);
        console.log(rand);
    }

    MoreOptions() {
        console.log('Test');
    }
}

export default RandButton;
